<h1 align="center"><span style="color: #ff0000;"><b>Что такое фотобудка?</b></span></h1>
<h6 style="text-align: justify;">Выездная фотобудка &#8212; это мобильная фотостудия и новое развлечение на любом мероприятии. Простой интерфейс и невероятный реквизит развеселит всех, а моментальные фотографии с логотипом вашего мероприятия станут отличным подарком каждому гостю и гарантируют успех мероприятия.</h6>
<h6 style="text-align: justify;">Практически все любят фотографироваться, особенно если позировать нужно не перед серьезным фотографом и на глазах у всех. Даже самые консервативные персоны с удовольствием расслабляются перед фотобудкой &#8212; строят забавные гримасы, получают массу положительных эмоций и фотографии в придачу.</h6>
<h6 style="text-align: justify;">Все гости, приглашенные на ваше мероприятие получат возможность сфотографироваться на память в компании друзей, коллег или любимого человека и всего через мгновение рассмотреть готовую фотографию.</h6>

